import React from "react";
import HomeLoop from '../partials/HomeLoop';
import {Provider} from '../context/Context';
import Pager from '../partials/Pager';

const Home = (props) => {
    return (
        <Provider router={props}>
        <div>
            <h1>Home</h1>
            <HomeLoop></HomeLoop>
            <button>Visit Blog</button>
        </div>
        </Provider>
    );
}

export default Home;
